import React from 'react';
import "./Headline.css"
import Searcher from '../Components/Searcher';
import testIcon from '../Resources/magnifier.png'
import { CookieLibrary } from '../Library';
import { serverRoot } from '../App';

class Headline extends React.Component 
{

	state={
		chImg : "---",
		chName : "aksda",

	}

	render() 
	{
		return (<header className='Headline'>
			<div className="SideIcon"
					style={{
						height: "10%",
					}}>
				<img 
					style={{
						height: "50px",
						filter: "invert()",
					}}	
					src = {testIcon}
					onClick={()=>{this.props.toggleFunc()}}></img>
			</div>
			<div>
				<i className="Logo"
					onClick={()=>{window.location.replace(`${window.location.origin}/`)}}
					>Dionysos</i>
				<Searcher></Searcher>
			</div>
			<div className="AccountDiv">
				<AccountCard
					chImg={this.state.chImg}
					chName={this.state.chName}></AccountCard>
			</div>
		</header>);
	}
}
class AccountCard extends React.Component
{
	state={
		isHighlightSignin : false,
	}


	GetUserId = ()=>{
		const cLib = new CookieLibrary();
		return cLib.getCookieValue("userId")
	}

	
    PostSignout = async () =>
		{
			const postData = {
				idLogin : this.state.idLogin,
				password : this.state.password,
			}
	
			const response = await(
				//요청
				await fetch(serverRoot + "/api/signin", {
					method: "POST", // 또는 'PUT'
					headers: {
						"Content-Type": "application/json",
					},
					body: JSON.stringify(postData),
				})
			);
	
			response.json().then(error => {
				console.log(error.message); // 서버에서 전달한 오류 메시지를 throw
				alert(error.message);
			});
	
			if(response.status == 200)
			{
				alert("로그인을 성공했습니다.");
				window.location.replace(`${window.location.origin}/`)
			}
		}




	render()
	{
		const userId = this.GetUserId();
		console.log("userID : " + userId)

		return userId != null? (
			<p 
				onMouseEnter={()=>{this.setState(current => {return { isHighlightSignin : true}} )}}
				onMouseLeave={()=>{this.setState(current => {return { isHighlightSignin : false}} )}}
				onClick={()=>{
					window.location.replace(`${window.location.origin}/signin`)
				}}
				style={{
					color: this.state.isHighlightSignin? "lightblue":"white",
					marginRight : "20px",
					fontSize : "20px",
				}}>
				<b>SIGNIN</b>
			</p>
		):(
			<div className="AccountCard"
			
			style={{
				display : "flex",
				alignItems : "center",
				textAlign : "left",
				width : "120px",
			}}>
				<img className='ChannelIcon'
					onClick={()=>{
						window.location.replace(`${window.location.origin}/profile`)
					}}
					src={`${serverRoot}/api/chImg/${this.props.chImg}`}>
				</img>
				<div style={{
						width : "75px",
					}}>
					<p style={{
							color:"white",
							fontSize : "20px",
							margin : "0",
						}}
						onClick={()=>{
							window.location.replace(`${window.location.origin}/profile`)
						}}>
						{this.props.chName}</p>
					<p style={{
						color: this.state.isHighlightSignin? "lightblue":"white",
						marginRight : "4px",
						fontSize : "10px",
					}}
						onMouseEnter={()=>{this.setState(current => {return { isHighlightSignin : true}} )}}
						onMouseLeave={()=>{this.setState(current => {return { isHighlightSignin : false}} )}}
						onClick={()=>{
							//TODO
							window.location.replace(`${window.location.origin}/signin`)
					}}>
						<b>SIGNOUT</b>
					</p>
				</div>
			</div>
		)
		
	}

}
export default Headline;
